import * as React from "react";
import { AppData } from "./appdata";

const Interests = () => {
  let { state, dispatch } = React.useContext(AppData);
  const interests = state.resume.interests;
  const [interest, setInterest] = useState(interest);
  return (
    <React.Fragment>
      <section className="res-editable res-interests rr" id="Interests">
        <div className="notepad-heading">
          <h2 className="label-maker">Interests</h2>
        </div>
        <ul className="paper">
          {interests.map((interest, index) => {
            const napClass = "rr nap" + index;
            return (
              <li key={index} className="carousel-cell">
                <h2>{interest.name}</h2>
                <blockquote>
                  <p>{interest.detail}</p>
                  <cite>{interest.cite}</cite>
                </blockquote>
              </li>
            );
          })}
        </ul>
      </section>
    </React.Fragment>
  );
};

export default Interests;
